import React, { HTMLAttributes } from "react";



export type Props = {
    children?: React.ReactNode;
    name?: string;
    submitting?: boolean;
    disabled?: boolean;
    type?: string;
}

export default function Button({ 
    children, name, submitting = false, ...props }: 
    Props) {
    return (
        <button
        className={name}
        >
        {props}
        </button>
    )
}
